import { Box } from '@material-ui/core';
import axios from 'axios';
import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';
import './App.css';
import { FilmCard } from './components/filmCard';

function App() {

  // const [data, setData] = useState<Array<Record<string, any>>>([]);
  const [data, setData] = useState<any[]>([]); 

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios(
        'https://api.themoviedb.org/3/discover/tv?api_key=92b418e837b833be308bbfb1fb2aca1e&language=fr-FR&sort_by=popularity.desc&page=1&timezone=America/New_York&include_null_first_air_dates=false',
      );
      setData(result.data.results);
    }
    fetchData();
  },[])

  console.log('%cApp.tsx line:25 data', 'color: #007acc;', data);

  function formatDate(datee :any) {
    var monthNames = [
      "January", "February", "March",
      "April", "May", "June", "July",
      "August", "September", "October",
      "November", "December"
    ];

    var day = datee.getDate();
    var monthIndex = datee.getMonth();
    var year = datee.getFullYear();

    return day + ' ' + monthNames[monthIndex] + ' ' + year;
  }
  console.log('%cApp.tsx line:40 formatDate()', 'color: #007acc;', formatDate(new Date()));

  return (
    <Box className="App">
      <header className="App-header">
        <h1>Mon header</h1>
      </header>
      <section>
        <h1>Ma section</h1>
        <Box display="flex" flexDirection="row">
          <ul>
            {data.map(item => (
              <li key={item.id}>
                <FilmCard name={item.name} textOverview={item.overview} imageSrc='https://image.tmdb.org/t/p/original/wr7nrzDrpGCEgYnw15jyAB59PtZ.jpg' date={item.first_air_date} />
              </li>
            ))}
          </ul>
        </Box>

        <img src="https://image.tmdb.org/t/p/original//wr7nrzDrpGCEgYnw15jyAB59PtZ.jpg" height="100px" width="100px"/>
      </section>
    </Box>
  );
}

export default App;
